import React from "react";
import {Line} from "react-chartjs-2";

const BarChart = () =>{
    return(
        <div>
            <Line

                data={{

                    datasets: [
                        {
                            label: 'WHATS THE LABEL GUYS',
                            data: [0, 10, 5, 2, 20, 30, 45],

                        }
                    ]
                }}
                height={400}
                width={600}
                options={{
                    maintainAspectRatio: false,
                }
                }


            />
        </div>
    )
}

export default BarChart
